import React from 'react';

const Style = {
    picture: {
        width: 400
    },
    diplayChips: {
        position: 'relative'
    }
}

function Project(props) {
    return (
        <div className="myproject">
            <img 
                src={props.imgUrl} 
                alt="project image" 
                style={Style.picture}/>
        </div>
    );
}

export default Project
